import FileService from 'app/service/FileService'
export default class IntrinioStocksHistoryRepositoryStub
{
    static fillSomeData()
    {
        let rawData = FileService.getInstance().readFile(__dirname + '/intrinio_data.json')
        console.log('rawData.length: ',rawData.length);
        let parsedData = JSON.parse(rawData);
        console.log('parsedData.count: ',parsedData.count);
        let list:Array<HistoryLineIntrinio>;
        list = parsedData.list;
        list.forEach((row)=>{
            let historyLineIntrinio = HistoryLineIntrinio.newFromJson(row);
            IntrinioStocksHistoryRepository.getInstance().add(historyLineIntrinio);
        });

        console.log('IntrinioStocksHistoryRepository.getInstance().count(): ',IntrinioStocksHistoryRepository.getInstance().count());




    }
}